import React, { Component } from 'react';
import Navigation from './Components/Navigation/Navigation';
import './App.css';

function App() {
  return (
    <div className="App">
     <Navigation />
     <Logo />
     <ImageLinkForm />
     <FaceRecognition />
    </div>
  );
}

export default App;
